import React from 'react';
import Card from './Card';
import './Card.css';

function App() {
  return (
    <div style={{ padding: '20px' }}>
      <Card title="Card 1" content="Conteúdo do card 1" />
      <Card title="Card 2" content="Conteúdo do card 2" />
    </div>
  );
}

export default App;
